/// Returns 1 for Unicode characters having the bidirectional
/// type 'WS', 'B' or 'S' or the category 'Zs', 0 otherwise.
internal func _PyUnicode_IsWhitespace(_ ch: UnicodeScalar) -> Bool {
    switch ch.value {
    case 0x0009,
         0x000A,
         0x000B,
         0x000C,
         0x000D,
         0x001C,
         0x001D,
         0x001E,
         0x001F,
         0x0020,
         0x0085,
         0x00A0,
         0x1680,
         0x2000,
         0x2001,
         0x2002,
         0x2003,
         0x2004,
         0x2005,
         0x2006,
         0x2007,
         0x2008,
         0x2009,
         0x200A,
         0x2028,
         0x2029,
         0x202F,
         0x205F,
         0x3000:
        return true
    default:
        return false
    }
}

/// Returns 1 for Unicode characters having the line break
/// property 'BK', 'CR', 'LF' or 'NL' or having bidirectional
/// type 'B', 0 otherwise.
internal func _PyUnicode_IsLineBreak(_ ch: UnicodeScalar) -> Bool {
    switch ch.value {
    case 0x000A,
         0x000B,
         0x000C,
         0x000D,
         0x001C,
         0x001D,
         0x001E,
         0x0085,
         0x2028,
         0x2029:
        return true
    default:
        return false
    }
}
